import React, { Component } from 'react'

export default class Item extends Component {
  render() {
    return (
      <div>
        <div className='col-lg-4'>
          <div className='card'>
            <div className='card-body'>
              <div>
                <i className="bi bi-collection"/>
              </div>
            </div>
          </div>
        </div>
        </div>
    )
  }
}
